import React from "react";
import Head from "next/head";

// COMPONENTS
import Menu from "./components/menu/menu";

export default function Layout(props) {
    return (
        <div>
            <Head>
                <title>My styled page</title>
                <link href="/static/styles.css" rel="stylesheet" />
            </Head>
            <Menu />
            {props.children}
        </div>
    );
}
